import Link from "next/link";

import styles from "../styles/index.module.scss";

const Index = () => {
  return (
    <div className={styles.container}>
      <section className={styles.logoLoginBanner}>
        <div>Logo IMG here later</div>
        <div className={styles.loginContainer}>
          <Link href="/login">
            <div className={styles.linkButton}>Admin</div>
          </Link>
          <Link href="/login">
            <div className={styles.linkButton}>Get Access</div>
          </Link>
        </div>
      </section>

      <section className={styles.missionStatement}>
        <div className={styles.anniversaryLogo}>
          Anniversary logo would go here!
        </div>
        <div className={styles.mission}>
          This side is where our mission statement goes!
        </div>
      </section>
    </div>
  );
};

export default Index;
